import * as style from "../../css/light/profileListContainer"

//Extends ProfileList
export default function ProfileListItem({data, focused, setFocused}) {
  const handleFocus = (e, type, id, assoc) => {
    if (e.target.style.cursor !== "pointer") return
    // for (let i in focused) if (e.target.innerHTML === focused[i][0].resources[0].data[id]) return
    // let newFocused = [[require(`../../data/${type}/${e.nativeEvent.path[1].innerText.split('\n')[0]}.json`), id, type, assoc], ...newFocused]
    setFocused(newFocused)
  }

  console.log(focused)

  const renderListDataMain = () => {
    return (
      <div style={style.profileListContainerMain}>
        {data[0]['data']}
      </div>
    )
  }

  const renderListDataOther = () => { //Change this to a React Component
    const renderDataList = () => {
      return data.slice(1, Object.keys(data).at(-1)).map((item, i) => (
        <div key={`LData${i}`} style={style.profileListContainerOther}>{item['data']}</div>
      ))
    }

    return (
      <div style={{display: "flex", width: "100%", marginLeft: "10px"}}>
        {renderDataList()}
      </div>
    )
  }

  return (
    <div>
      <div 
      onMouseEnter={(e) => {
        e.currentTarget.style.border = "1px solid black"  
      }}
      onMouseLeave={(e) => {
        e.currentTarget.style.border = "1px solid #4382BC"
      }}
      onClick={(e) => {
        handleFocus(e)
      }}
      style={style.profileListContainer}>
        {renderListDataMain()}
        {renderListDataOther()}
      </div>
      <div style={{height: "3px", cursor: "default"}}></div>
    </div>
  )
}
